void pcf8833_init( u8 vl_ContrastLevel)
{
	Clr_Rst;// 硬件复位
	_delay_us(10000);
	Set_Rst;
	_delay_us(10000);

	pcf8833_register_init( vl_ContrastLevel);
	LCDClearScreen(BLUE);
}
///////////////////对比度设置///////////////////////
void pcf8833_set_contrast(u8 vl_ContrastLevel)
{
	//设置对比度
	MC_DSC_COMMAND_WRITE(DSC_PCF8833_REG_SETCON);
	MC_DSC_DATA_WRITE(a_contrast_tab_pcf8833[vl_ContrastLevel]);
}
/////////////显示 picture1中内容,整屏刷新///////////////////
void pcf8833_update_screen( u8 v_x1, u8 v_y1, u8 v_x2, u8 v_y2)
{

   u8  *s;
   long    i;
   if(v_x2 >= 128) v_x2 = 127;
   if(v_y2 >= 128) v_y2 = 127;
   if(v_x1 > v_x2 || v_y1 > v_y2) return;
	 
  // v_x1 &= 0xfe;       //if vp_Xtl is odd, dec 1
  // v_x2 |= 0x01;       //if vp_Xbr is even, inc 1

   // set column range   列地址设置（X坐标）X address start; 0 ≤ xs ≤ 83H        x address end; xs ≤ xe ≤ 83H  
   MC_DSC_COMMAND_WRITE(DSC_PCF8833_REG_COLUMN_SET);
   MC_DSC_DATA_WRITE(v_x1);
   MC_DSC_DATA_WRITE(v_x2);

   // set page(line) range  页地址设置（Y坐标）Y address start; 0 ≤ ys ≤ 83H        Y address end; ys ≤ ye ≤ 83H
   MC_DSC_COMMAND_WRITE(DSC_PCF8833_REG_PAGE_SET);
   MC_DSC_DATA_WRITE(v_y1);
   MC_DSC_DATA_WRITE(v_y2);
   
   ////写RAM 
   MC_DSC_COMMAND_WRITE(DSC_PCF8833_REG_RAMWR);
   // s point to the address of (vp_Xtl, vp_Ytl) in RAM
	s = (u8*)(picture1);
	for(i = 0; i < sizeof(picture1); i++) {
		   MC_DSC_DATA_WRITE(pgm_read_byte_near(s++));
	}
   ////显示 开
   MC_DSC_COMMAND_WRITE(DSC_PCF8833_REG_DISPON);
}
//////////////////////寄存器初始化//////////////////////
void pcf8833_register_init( u8 vl_ContrastLevel)
{
	////显示 关
	MC_DSC_COMMAND_WRITE(DSC_PCF8833_REG_DISPOFF);
	MC_DSC_COMMAND_WRITE(DSC_PCF8833_REG_SFD);          //Disable Factory Defaults
	//Set Multipliction = 4X  设置倍频系数
	MC_DSC_COMMAND_WRITE(DSC_PCF8833_REG_SETMUL);
	_delay_ms(1);
	MC_DSC_DATA_WRITE(0x02);
	_delay_ms(1);
	//Set VOP, The below value is important and it will effect the display  设置Vop
	MC_DSC_COMMAND_WRITE(DSC_PCF8833_REG_SET_VOP);
	MC_DSC_DATA_WRITE(0x09);
	MC_DSC_DATA_WRITE(0x14);   //Set the value according to above register
	//Set Contrast  设置对比度
	MC_DSC_COMMAND_WRITE(DSC_PCF8833_REG_SETCON);
	MC_DSC_DATA_WRITE(a_contrast_tab_pcf8833[vl_ContrastLevel]);   //No operation (NOP)
	//Set Bias  设置偏移系统
	MC_DSC_COMMAND_WRITE(DSC_PCF8833_REG_SETBS);
	MC_DSC_DATA_WRITE(0x0f);
	//Set Frame Frequency  设置除法器频率
	MC_DSC_COMMAND_WRITE(DSC_PCF8833_REG_TCDF);
	MC_DSC_DATA_WRITE(0x38);
	MC_DSC_DATA_WRITE(0x15);
	MC_DSC_DATA_WRITE(0x15);
	MC_DSC_DATA_WRITE(0x15);
	//Temperture Compensation Set   设置TCVOP斜线A和B 
	MC_DSC_COMMAND_WRITE(DSC_PCF8833_REG_TCVOPAB);
	MC_DSC_DATA_WRITE(0x22);
	//设置TCVOP斜坡C和D
	MC_DSC_COMMAND_WRITE(DSC_PCF8833_REG_TCVOPCD);
	MC_DSC_DATA_WRITE(0x11);
	//Sleep out  睡眠 退出
	MC_DSC_COMMAND_WRITE(DSC_PCF8833_REG_SLEEP_OUT);
	_delay_ms(1);
	//Color Interface Pixel Format 16bit/pixel  接口像素格式化
	MC_DSC_COMMAND_WRITE(DSC_PCF8833_REG_COLMOD);
	MC_DSC_DATA_WRITE(0x03);
	//Booster Voltage on  升压电压开
	MC_DSC_COMMAND_WRITE(DSC_PCF8833_REG_BSTRON);
	_delay_ms(100);
	//Normal Display Mode ON  正常显示模式
	MC_DSC_COMMAND_WRITE(DSC_PCF8833_REG_NORON);
	//Dispaly inversion On  反向显示开
	MC_DSC_COMMAND_WRITE(DSC_PCF8833_REG_INVON);
	//N line inversion n行反转
	MC_DSC_COMMAND_WRITE(DSC_PCF8833_REG_NLI);
	MC_DSC_DATA_WRITE(0x25);
	//Super Frame Inversion On  B9H super Frame INVersion (FINV) 超级框架反转
	MC_DSC_COMMAND_WRITE(DSC_PCF8833_REG_FINV);
	//Memory data Access Control  内存数据的访问控制
	MC_DSC_COMMAND_WRITE(DSC_PCF8833_REG_MADCTL);
	MC_DSC_DATA_WRITE(0x48);
	//BRS = 0 x底行交换
	MC_DSC_COMMAND_WRITE(DSC_PCF8833_REG_BRS);
	//TRS = 0  x顶行交换
	MC_DSC_COMMAND_WRITE(DSC_PCF8833_REG_TRS);
}
void LCDClearScreen(u16 colour ) {
	
	long  i;    // loop  c oun ter
	
	// Row addre ss set  (com mand 0x2B) 页地址设置（Y坐标）Y address start; 0 ≤ ys ≤ 83H        Y address end; ys ≤ ye ≤ 83H    
	MC_DSC_COMMAND_WRITE(DSC_PCF8833_REG_PAGE_SET);
	MC_DSC_DATA_WRITE (0);
	MC_DSC_DATA_WRITE (131);
	
	// Column ad dress set  ( command 0x2A )列地址设置（X坐标）X address start; 0 ≤ xs ≤ 83H        x address end; xs ≤ xe ≤ 83H 
	MC_DSC_COMMAND_WRITE(DSC_PCF8833_REG_COLUMN_SET);
	MC_DSC_DATA_WRITE (0);
	MC_DSC_DATA_WRITE (131);
	
	// set the d isplay memor y to BLACK 写RAM
	MC_DSC_COMMAND_WRITE(DSC_PCF8833_REG_RAMWR);
	for (i =  0;  i < (131*131/2); i ++) {
		MC_DSC_DATA_WRITE ((colour >> 4) & 0xFF);
		MC_DSC_DATA_WRITE (((colour & 0xF) << 4)  |  ((colour >> 8) & 0xF));
		MC_DSC_DATA_WRITE (colour & 0xFF); 
	  }
	//显示 开
	MC_DSC_COMMAND_WRITE(DSC_PCF8833_REG_DISPON);
}
